import React from "react";
import MovieCard from "../MovieCard/MovieCard";
import "./style.css";
import { MovieContext } from "./Components/Provider/";

export default function Movielist() {
  return (
    <MovieContext.Provider>
      <div className="container">
        <MovieCard />
      </div>
    </MovieContext.Provider>
  );
}
